import React, { useState } from 'react';
import './Login.css';
import { Link, NavLink  } from "react-router-dom";
const Login = () => {
  const [showPassword, setShowPassword] = useState(false);

  const togglePasswordVisibility = () => {
    setShowPassword(!showPassword);
  };

  return (
    <>
      <meta charSet="UTF-8" />
      <title>Login Page</title>
      
      <style
        dangerouslySetInnerHTML={{
          __html:
            "\n\t\thtml,\n\t\tbody {\n\t\t\theight: 100%;\n\t\t}\n\n\t\t.container {\n\t\t\twidth: 70%;\n\t\t\theight: 90%;\n\t\t\tpadding: 140px 0 ;\n\t\t\tmargin-top: 40px;\n\t\t}\n\t"
        }}
      />
      <div className="container1-7">
        <h5>Login</h5>
        <form action="">
          <input
            type="text"
            placeholder="Enter your username"
            name="username"
            required=""
          />
          <br />
          <input
            type={showPassword ? 'text' : 'password'}
            placeholder="Enter your password"
            name="psw"
            id="password"
            required=""
          />
          <span onClick={togglePasswordVisibility}>
            <i
              id="toggler"
              className={`far ${showPassword ? 'fa-eye-slash' : 'fa-eye'}`}
            />
          </span>
          <br />
          <input type="submit" defaultValue="Login" className="button7"/>
        </form>
        <div
          style={{
            textAlign: "center",
            fontSize: 14,
            color: "#8a93a5",
            marginTop: 30
          }}
        >
          Don't have an account?{" "}
          <Link   to="/signupage">
            Create Your Account
          </Link>
        </div>
      </div>
    </>
  );
};

export default Login;
